INSERT INTO `firms` (`idf`, `name`, `aboutf`, `address`, `web`, `country`) VALUES
(1, 'ABF Elettronica SRL', 'ABF Core Business is represented by RF and Microware Passive Devices, mainly Filters and Diplexers up to 50 Ghz (cavity, dielectric resonator, wave guide or coaxial), Cilculators, Isolators, Couplers and Branching Solutions but even Flexible Waveguide Seamless, Waveguide Components and Feeds. ABF’s plus are: Manufacturing Plant located ', 'Via Ciro Menotti, 60 20043, Acrore (MI), Italy', 'www.abfelettronica.i', 'Italy'),
(2, 'ACAL Technology', 'ACAL Technology is a leading value-added distributor providing specialist design-in, sales and marketing services for international suppliers in the fields of Semiconductors, RF and Wireless, Power Management and Board level Systems. Acal Technology''s RF & Wireless portfolio includes many of the world''s leading suppliers, including RFMD (general purpose amplifiers, low noise amplifiers and discretes, high linearity amplifiers and discretes, modulators and demodulators, VCOs and PLLs, couplers and mixers), L', 'Beatrix de Rijkweg 12, NL-5657 EG, Eindhoven, Netherlands', 'www.acaltechnology.c', 'Netherlands'),
(3, 'Acceleware Corp.', 'Acceleware develops and markets acceleration products that bring unparalleled performance and speed to today''s most challenging compute and data-intensive demands. Run times for data processing and sumulation applications are reduced by more than 50 times. Our customers share a common and urgent need - the need for powerful and timely computer modeling and testing. They are pushing the boundaries of innovation and demand faster product-development cycles for more complex products. With Acceleware''s products', '1600 37th St. Sw, Calgary, Alberta, T3C 3P1, Canada', 'http://www.accelewar', 'Canada'),
(4, 'Actipass Co. Ltd.', 'Actipass R & M Co., Ltd. In Korea is a fine and leading manufacturer in the field of RF & Microware components & systems related to CDMA, WCDMA, GSM and satellite communication systems ever since it was established in Aug. 1992. For the future information, please visit our website www.actipassrnm.com . We consider that customers come first in our business activity. This is our main philosophy, which defines Actipass R & M''s spirit and corporate identity.', '366 Kwirae-Ri, Jeongnam-Myun, Hwaseong-Si, Gyeonggi-Do, Korea', 'www.actipass.com', 'Korea'),
(5, 'Advanced Control Components Inc.', 'Advanced Control Components designs and manufactures high performance components and custom integrated multi-function assemplies to 40GHz serving commercial, industrial, military and space applications. Products include amplifiers, attenuators, detectors, frequency converters, limiters, phase shifters, switches, switch matrices and synthesizers. Advanced Control Components also provides RF and microware design, analysis, manufacturing and test services.', '611 Industrial Way West, Eatontown, New Jersey, 07724', 'www.advanced-control', ''),
(6, 'Aeroflex', 'Aeroflex is a leading worldwide provider of highly specialized test and measurement equipment and microelectronic solutions. Aeroflex''s Test Solutions group will have on display at European Microware Week 2008 its line of 6820 Series Microware Scalar Analysers and 6840 Series Microware System Analyzers as well as spectrum analyzers, broadband signal analyzers and generators and the Synthetic Model 5000 test environment. Aeroflex''s Microelectronic Solutions RFMW divisions that will be participating are Aerof', 'Longacres House, Six Hills Way, Stevenage, Herts, SG1 2AN, UK', 'www.aeroflex.com', ''),
(7, 'Aethercomm', 'Aethercomm designs and manufactures high power RF and microwave amplifiers for use in CW and pulsed applications. Aethercomm covers the frequency range from DC to 40 GHz. Aethercomm products are used in radar systems, electronic warfare systems, communication systems and test and measurement applications. Aethercomm also designs and manufactures transmitters, transceivers and RF/microwave subsystems and systems. Aethercomm’s design and manufacturing facilities are located in San Marcos, CA in San Diego Coun', '2910 Norman Strasse Road, Suite 105, San Marcos, California 92069, USA', 'www.aethercomm.com', ''),
(8, 'Agilent Technologies', 'Agilent Technologies is the world''s premier measurement company and a technology leader in communications, electronics, life sciences and chemical analysis. The company''s 20 000 employees serve customers in more than 110 countries. Agilent had net revenues of $5,4 billion in fiscal 2007. No other company offers the breadth and depth of measurement tools and expertise to meet the world''s critical requirements for electronic and bio-analytical measurement. With our long track record and our exclusive focus on', 'Groenelaan 5, 1186 AA, Amstelveen, The Netherlands', 'www.agilent.com', ''),
(9, 'Air-Parts BV', '-', 'Kalkovenweg 12, 2401 LK, Aiphen aan den Rijn, Netherlands', 'www.air-parts.com', ''),
(10, 'Alfred Tronser Gmbh', 'Alfred Tronser GmbH specializes for more than 55 years in the design, manufacturing and sales of Trimmer Capacitors and today offers the widest range of High - Q Trimming Capacitors to include Air Dielectric Plate-Tubular and Sappphire Dielectric Trimmers as well as Microwave Tuning Elements in resistive, dielectric and inductive styles. Milled Microwave and Filter Housings and pre-tuned Filter Covers in addition to Precision Turned Parts compliment the product range.', 'Quellenweg 14, 75331 Engelsbrand, Germany', 'http://www.tronser.c', 'Germany'),
(11, 'AMCAD Engineering', 'AMCAD Engineering is dedicated to providing the most advanced solutions and tools in test and modelling to the RF and microwave IC market. Component characterization and modelling are crucial steps to perform optimal circuit designs. The last AMCAD 240V-10A PIV measurement system is compatible with Agilent PNA-X in order to provide state-of-the-art solution for high power transistors characterization.', 'Ester Technopole BP6915, 87069 Limoges, France', 'www.amcad-engineerin', 'France'),
(12, 'American Technical Ceramics Europe AB (ATC)', 'American Technical Ceramics Corp. (ATC) provides component and custom integrated packaging solutions for the RF, microwave and telecommunications industries. ATC designs, develops, manufactures and markets Multilayer Capacitors, Single Layer Capacitors, Resistive Products, Inductors and Custom Thin Film Products for RF, microwave and millimeter-wave applications. ATC products are primarily focused on the wireless communications infrastructure, fiber optic, medical electronics, semiconductor manufacturing eq', 'Ellipsvagen 5, SE-141 75, Kurgens Kurva, Sweden', 'www.atceramics-europ', 'Sweden'),
(13, 'ATE System', '-', '-', 'http://www.atesysmte', 'USA'),
(14, 'Texas Instruments', '-', '-', 'http://www.ti.com/', '=-'),
(15, 'Johanson Technology', 'Johanson Technology focuses specifically on the RF, microwave and optical markets. The company produces superior high frequency ceramic solutions through optimization of ceramics, inks and RF circuit designs. Some specific RF components available from Johanson Technology include filters, antennas, and baluns.', 'd', 'http://johansontechn', 'd'),
